  return (
    <button style={{
      backgroundColor: "tomato",
      color: "white",
      padding: "10px 20px",
      border: 0,
      borderRadius: 10
    }}>Save Changes</button>
  )
}

function ConfirmBtn() {
  return <button>Confirm</button>
}

function App() {
  const [index, setIndex] = React.useState('1');
  const onIndexChange = (e) => {
    setIndex(`${e.target.value}`);
  };
  return (
    <div>
      <SaveBtn/>
      <ConfirmBtn/>
    </div>
  );
}

export default App;
